/*Data for the table `n_departClassification` */

insert  into `n_departClassification`(`c_id`,`c_name`) values ('D001','临床科'),('D002','医技科'),('D003','急诊科'),('D004','心内科'),('D005','肺病科'),('D006','脾胃病科'),('D007','肝病科');

/*Table structure for table `n_department` */

DROP TABLE IF EXISTS `n_department`;

CREATE TABLE `n_department` (
  `d_id` varchar(100) NOT NULL COMMENT '科室编码',
  `d_avatar` varchar(100) DEFAULT NULL COMMENT '科室图片',
  `d_classification` char(4) DEFAULT NULL COMMENT '科室分类',
  `d_name` varchar(50) DEFAULT NULL COMMENT '科室名称',
  `d_introduce` varchar(200) DEFAULT NULL COMMENT '科室介绍',
  PRIMARY KEY (`d_id`),
  KEY `class_dekey` (`d_classification`),
  CONSTRAINT `class_dekey` FOREIGN KEY (`d_classification`) REFERENCES `n_departClassification` (`c_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `n_department` */

insert  into `n_department`(`d_id`,`d_avatar`,`d_classification`,`d_name`,`d_introduce`) values ('DE001','http://localhost:8000/hospital/Img/department/DE001.jpg','D001','急诊科','本科室诊疗范围包括急性心肌梗死、主动脉夹层、急性呼吸衰竭、休克、脓毒血症、心功能衰竭、脑血管意外、严重创伤、呼吸心跳骤停及其他急危重症。 尤其擅长诊治心脑肺复苏、脓毒血症、脓毒性休克、多器官功能障碍综合征、急性呼吸窘迫综合征、严重创伤及大手术后综合管理、物理/化学因素所致急危重症'),('DE002','http://localhost:8000/hospital/Img/department/DE002.jpg','D001','内科','内科学包含了依不同器官系统而分类的次专科：心脏内科、呼吸科、肝胆肠胃科、肾脏科（泌尿内科）、血液科、肿瘤科、内分泌科、传染病科、免疫科、风湿科、神经科、儿科、神经内科、老年病科等，但各地甚至各医院对次专科的分类可能有所不同。 各次专科多半有成立各自的医学会，各自审查次专科医师的资格并举办学术活动。'),('DE003','http://localhost:8000/hospital/Img/department/DE003.jpg','D001','外科','普通外科专业、骨科专业、泌尿外科专业、乳腺外科专业、肛肠外科专业等；共有医师8人，其中副主任医师5人，主治医师3人。\r\n外科专业是本院的核心业务之一。'),('DE004','http://localhost:8000/hospital/Img/department/DE004.jpg','D001','妇产科','妇产科是临床医学四大主要学科之一，主要研究女性生殖器官疾病的病因、病理、诊断及防治，妊娠、分娩的生理和病理变化，高危妊娠及难产的预防和诊治，女性生殖内分泌，计划生育及妇女保健等。现代分子生物学、肿瘤学、遗传学、生殖内分泌学及免疫学等医学基础理论的深入研究和临床医学诊疗检测技术的进步，拓宽和深化了妇产科学的发展，为保障妇女身体和生殖健康及防治各种妇产科疾病起着重要的作用。'),('DE005','http://localhost:8000/hospital/Img/department/DE005.jpg','D002','药房','药房基本介绍 药房主要销售西药、中成药、草药等各种药品，以方便人民群众购买药品, 以利于人民群众健康。 药房是还负责药品的计划预算、验收入库、领发保管药品、统计报销等，对于药房的工作人员，国家和医疗卫生部门都有明确的规定，并且制定了相关的规章制度和从业要求。'),('DE006','http://localhost:8000/hospital/Img/department/DE006.jpg','D002','化验室','检验科为临床医学检验实验室，主要是对血液，唾液，尿样等体液进行检验分析。设临检、微生物、生化、免疫、艾滋病检测点等六个实验部门和血库。'),('DE007','http://localhost:8000/hospital/Img/department/DE007.jpg','D002','消毒供应室','消毒供应中心是医院内各种无菌物品的供应单位，它担负着医疗器材的清洗、包装、消毒灭菌和供应工作。现代医院供应品种繁多，涉及科室广，使用周转快，每项工作均关系到医疗、教学、科研的质量'),('DE009','http://localhost:8000/hospital/Img/department/DE009.jpg','D003','皮肤科','皮肤科属于外科，主要治疗各种皮肤病，常见皮肤病有牛皮癣 、 疱疹 、酒渣鼻 、脓疱疮 、化脓菌感染 、疤痕 、癣 、鱼鳞病 、腋臭 、青春痘 、毛囊炎 、斑秃脱发 、男科炎症 、婴儿尿布疹 、鸡眼 、雀斑 、汗疱疹 、螨虫性皮炎 、白癜风 、湿疹 、灰指甲 、硬皮病 、皮肤瘙痒 、口腔部护理 、脱毛 、黄褐斑等'),('DE010','http://localhost:8000/hospital/Img/department/DE010.jpg','D003','男科','男科就是关爱男性健康，重视男科疾病科学诊治的一个学科。 男科诊疗范围很广，可粗略地分成4大块，即男子不育、性功能障碍（ED），前列腺疾病、性传播疾病。 从健康的新概念出发，以前男子健康相对被忽视，只有妇科没有男科，男性的寿命低于女性。'),('DE223','http://localhost:8000/hospital/Img/department/DE223.jpg','D005','眼科','眼科介绍');

/*Table structure for table `n_doctor` */

DROP TABLE IF EXISTS `n_doctor`;

CREATE TABLE `n_doctor` (
  `d_id` varchar(100) NOT NULL COMMENT '医生id',
  `d_name` varchar(50) DEFAULT NULL COMMENT '医生姓名',
  `d_age` int(11) DEFAULT NULL COMMENT '医生年龄',
  `d_sex` char(4) DEFAULT NULL COMMENT '医生性别',
  `d_schedule` char(4) DEFAULT NULL COMMENT '医生排班规则',
  `d_department` varchar(100) DEFAULT NULL COMMENT '医生所在科室',
  `d_regis` varchar(100) DEFAULT NULL COMMENT '挂号级别',
  `d_delete` int(11) DEFAULT '0' COMMENT '逻辑删除',
  PRIMARY KEY (`d_id`),
  KEY `doctor_depart` (`d_department`),
  KEY `doctor_schedule` (`d_schedule`),
  KEY `doctor_regis` (`d_regis`),
  CONSTRAINT `doctor_depart` FOREIGN KEY (`d_department`) REFERENCES `n_department` (`d_id`),
  CONSTRAINT `doctor_regis` FOREIGN KEY (`d_regis`) REFERENCES `n_registered` (`r_id`),
  CONSTRAINT `doctor_schedule` FOREIGN KEY (`d_schedule`) REFERENCES `n_schedule` (`s_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

